const Cart = ({ cart }) => {

    const cartItems = cart.map(item => {
        return (<li key={item.id}>
            {item.name} - ${item.price}
        </li>)
    })

    return ( 
        <div className="cart-container">
            <div className="cart">
                {cart.length === 0 && "Your cart's empty, partner!"}
                <ul>
                    {cartItems}
                </ul>
                <button>Back to shoppin'</button>
                <button>Checkout</button>
            </div>
        </div>
     );
}

export default Cart;
